Diagnosis
. Male cephalic horns lacking granules internally at apex (
Fig. 48
); males with pronotal anterior angles surface flat, at most slightly produced anteriorly (
Fig. 47
); FLP sclerite ventral portion with a single carina (
Fig. 173
); SA sclerite apex interrupted much before apex of apical portion of FLP sclerite (
Figs. 171–172
).

Natural history . The distribution of this species in the soudanian zone and forest/savanna mosaic areas, with intrusions in the northern portion of the central forest block, suggests that it can colonize wetter environments when used as pastures. All Cameroonian and Central African records are from pastures in forest/savanna mosaic. Few individuals were collected from the Sahelian region. Specimens were collected from ruminants and non-ruminants such as cow, elephant, roan antelope (
Hippotragus equinus
), pig, rhinoceros, warthog, and zebra dung. This species is attracted to mercury vapor and ultraviolet light.
